      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 + col1 BETWEEN ( col1 ) AND ( + + col0 ) - - ( col0 ) * 11;
  - name: tab1

outputs:
